import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import * as serviceWorker from './serviceWorker';
import {createStore, combineReducers, applyMiddleware} from 'redux';
import thunkMiddleware from 'redux-thunk';
import {searchItems} from './Reducers.js';
import App from './App';

import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';
import './Components/fonsts/AnonymousPro-Bold.ttf'

// const rootReducers = combineReducers({searchItems});
export const Store = createStore(searchItems, applyMiddleware(thunkMiddleware));

ReactDOM.render(
  <React.StrictMode>
    <Provider>
      <App store={Store}/>
    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
